    {ntt"total": 53,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2013-03-15T21:13:53.406436",nt"name": "drainage-basins-used-for-development-of-the-watershed-regressions-for-pesticides-warp-model",nt"isopen":
    false,nt"url": null,nt"notes": "This data set consists of 204 drainage
    basin boundaries for U.S. Geological Survey's (USGS) stream sites sampled in the
    National Water Quality Assessment (NAWQA) Program and the National Stream Quality
    Accounting Network (NASQAN). These drainage basin boundaries are used to generate
    watershed characteristics for the development of water-quality models. The basin
    boundaries were collected from USGS hydrologists and geographers from 1995 through
    2008. Correspondingly, the scale or resolution of the boundaries varies, and common
    boundaries shared by adjacent and nested drainage basins are not entirely coincident.
    About 60% of the basin boundaries were developed from data sources at the scale
    of 1:24,000 or resolution of 30-meters or less. Overall, the basin boundaries at
    the lower resolution represent large, major drainage basins. The 204 drainage basins
    range in size from about 10 square kilometers to over 2,000,000 square kilometers.
    Collectively, the drainage basins cover approximately 60% of the conterminous United
    States, and include a number of nested basins.",nt"license_title": null,nt"extras":
